  \"2014-04-15T17:01:37.292490\",\n\t\"name\": \"bismarck-mandan-topographic-one-foot-contours-2013\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The project established topographic mapping
  to 1-foot interval contours using LiDAR (Light Detection and Ranging) for the Bismarck-Mandan
  Metropolitan Planning Organization (MPO).  The MPO is comprised of the City of Bismarck,
  City of Mandan, City of Lincoln, and portions of Burleigh and Morton Counties in
  North Dakota.  The Bare Earth DTM was developed from LAS points and breaklines collected
  from a LiDAR flight flown in the Spring of 2013. The DTM is used to develop a TIN
  (Triangulated Irregular Network). One-foot contours meeting National Map Accuracy
  Standards were generated from the TIN.\",\n\t\"license_title\": null,\n\t\"extras\":
